// Navbar.js

import React from 'react';
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function AppNavbar() {
  return (
    <Navbar expand="lg" style={{ backgroundColor: "gray" }}>
      <Container>
        <Nav.Item style={{ fontSize: "200%", color: "orange", fontStyle: "italic" }}> ðŸŽ¬  MOVIES</Nav.Item>
        <Navbar.Toggle aria-controls="navbarNavDropdown" />
        <Navbar.Collapse id="navbarNavDropdown">
          <Nav className="mr-auto">
            <Nav.Link to="/n" active style={{ paddingLeft: "280%" }}>
              Home
            </Nav.Link>
            <Nav.Link to="/home">Favourites</Nav.Link>

            <NavDropdown title="Dropdown link" id="navbarDropdownMenuLink">
              <NavDropdown.Item to="#">Login</NavDropdown.Item>
              <NavDropdown.Item to="#">Register</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
